import "./../node_modules/video-react/dist/video-react.css"
import React from 'react'
import { Container, Card, Title, Text } from './styles/app.styles'
import { Player } from "video-react"
import video from "./assets/video/video1.mp4"
import image from "./assets/image/flyer.png"
function App() {
  return (
    < Container >

      <Title> Seja Bem Vindo!, Abra o video e mude sua vida! </Title>
      <Card alignItems="center">
        <video src={video} height="400px" width="800px" controls autoPlay muted />
        <image src={image} />
      </Card>

    </Container >
  );
}

export default App;
